frappe.web_form.after_load = () => {
    console.log("ðŸ” Waiting for child table grid to become ready...");

    const waitForGrid = setInterval(() => {
        const grid = frappe.web_form.fields_dict.table_ctkk?.grid;  // âœ… use actual fieldname

        if (grid && grid.wrapper && grid.wrapper.length) {
            clearInterval(waitForGrid);
            console.log("âœ… table_ctkk child table grid is ready. Attaching BMI listeners...");

            grid.wrapper.on("blur", 'input[data-fieldname="current_weight"], input[data-fieldname="current_height"]', function () {
                const $row = $(this).closest(".grid-row");

                const weight = parseFloat($row.find('input[data-fieldname="current_weight"]').val());
                const height_cm = parseFloat($row.find('input[data-fieldname="current_height"]').val());
                const $bmi_input = $row.find('input[data-fieldname="bmi"]');

                if (weight > 0 && height_cm > 0) {
                    const height_m = height_cm / 100;
                    const bmi = weight / (height_m * height_m);
                    const rounded_bmi = Math.round(bmi * 10) / 10;
                    $bmi_input.val(rounded_bmi).trigger("change");
                    console.log(`âœ… BMI calculated: ${rounded_bmi}`);
                } else {
                    $bmi_input.val("").trigger("change");
                    console.log("âš ï¸ Invalid or missing weight/height");
                }
            });

            console.log("âœ… BMI listeners attached to child table rows.");
        }
    }, 200);
};

